import { useNavigate } from 'react-router-dom';
import '../css/buttons.css';


export function ChatBTN() {
  

  const handleClick = () => {
    window.location.href = "http://localhost:8000";
  };

  return (
    <div class="flo-btn-chat">
      <button class="flo flo-chat" onClick={handleClick}>Chat</button>
    </div>
  );
}

export function HelpBTN() {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate('/help');
  };

  return (
    <div class="flo-btn-help">
      <button class="flo flo-help" onClick={handleClick}>Help</button>
    </div>
  );
}
